$(document).ready(function(){
  $('#notifications').on("click", function() {
    var notification_ids = $('#notification').val();
    $('.badgeAlert').remove();
    alert(notification_ids);
    $.ajax({
      type: 'GET',
      url: '/notifications',
      data: {notification_ids: notification_ids}
    });
  })
})
